# servicebus.properties - sample JNDI configuration
# Register a ConnectionFactory in JNDI using the form: # connectionfactory.[jndi_name] = [ConnectionURL] connectionfactory.SBCF = amqps://SendRule:{Send Rule key}@{namespace name}.servicebus.windows.net/?sync-publish=false
# Register some queues in JNDI using the form # queue.[jndi_name] = [physical_name] # topic.[jndi_name] = [physical_name] queue.EventHub = {event hub name}

 import java.io.BufferedReader;
 import java.io.IOException;
 import java.io.InputStreamReader;
 import java.io.UnsupportedEncodingException;
 import java.util.Hashtable;

 import javax.jms.BytesMessage;
 import javax.jms.Connection;
 import javax.jms.ConnectionFactory;
 import javax.jms.Destination;
 import javax.jms.JMSException;
 import javax.jms.MessageProducer;
 import javax.jms.Session;
 import javax.naming.Context;
 import javax.naming.InitialContext;
 import javax.naming.NamingException;

 public static void main(String[] args) throws NamingException,
         JMSException, IOException, InterruptedException {
     // Configure JNDI environment
     Hashtable<String, String> env = new Hashtable<String, String>();
     env.put(Context.INITIAL_CONTEXT_FACTORY,
             "org.apache.qpid.amqp_1_0.jms.jndi.PropertiesFileInitialContextFactory");
     env.put(Context.PROVIDER_URL, "servicebus.properties");
     Context context = new InitialContext(env);

     ConnectionFactory cf = (ConnectionFactory) context.lookup("SBCF");

     Destination queue = (Destination) context.lookup("EventHub");

     // Create Connection
     Connection connection = cf.createConnection();

     // Create sender-side Session and MessageProducer
     Session sendSession = connection.createSession(false,
             Session.AUTO_ACKNOWLEDGE);
     MessageProducer sender = sendSession.createProducer(queue);

     System.out.println("Press Ctrl-C to stop the sender process");
     System.out.println("Press Enter to start now");
     BufferedReader commandLine = new java.io.BufferedReader(
             new InputStreamReader(System.in));
     commandLine.readLine();

     while (true) {
         sendBytesMessage(sendSession, sender);
         Thread.sleep(200);
     }
 }

 private static void sendBytesMessage(Session sendSession, MessageProducer sender) throws JMSException, UnsupportedEncodingException {
     BytesMessage message = sendSession.createBytesMessage();
     message.writeBytes("Test AMQP message from JMS".getBytes("UTF-8"));
     sender.send(message);
     System.out.println("Sent message");
 }
